export default function Footer() {
  return (
    <footer className="py-6 bg-black">
      <div className="container">
        <div>
          <a hre className="flex items-center gap-x-3">
            <img
            className="w-10 h-[30px]"
              src="./image/png/AFblog 1.png"
              alt="Site Logo"
            />
            <span className="font-SoraBold text-xl/6 text-white tracking-tighter">AFblog</span>
          </a>
          <div></div>
        </div>
      </div>
    </footer>
  );
}
